import React,{Component} from 'react';
class Landingcontent extends React.Component{
	constructor(props){
		super(props)

	}
	render(){
		return(
			<div>
			<div className="main1">
				<div className="c1">
					
				</div>
				<div className="c2">
				</div>

				<div className="c3">

				</div>
			</div>

			
			<style jsx>{`
				.main1{

					display:flex;
					flex-direction:row;
					background:black;
					height:500px;
					margin-top:80px;
					align-items:center;
					justify-content:space-around;
					flex-wrap: wrap;


				}
				.c1{
					display:flex;
					
					background:white;
					height:70%;
					width:350px;
					 border: 5px solid red;
					
				}
				.c2{
					display:flex;
					width:350px;
					background:white;
					height:70%;
					 border: 5px solid red;
					
				}
				.c3{
					display:flex;
					width:350px;
					background:white;
					height:70%;
					 border: 5px solid red;
				}
				`}</style>

			</div>

		)
	}
}
export default Landingcontent
